{
  "description": "<p>Initiate 3D Secure authentication.</p>",
  "operationId": "Post3dSecure",
  "requestBody": {
    "content": {
      "application/x-www-form-urlencoded": {
        "encoding": {
          "expand": {
            "explode": true,
            "style": "deepObject"
          }
        },
        "schema": {
          "additionalProperties": false,
          "properties": {
            "amount": {
              "description": "Amount of the charge that you will create when authentication completes.",
              "type": "integer"
            },
            "card": {
              "description": "The ID of a card token, or the ID of a card belonging to the given customer.",
              "maxLength": 5000,
              "type": "string"
            },
            "currency": {
              "description": "Three-letter [ISO currency code](https://www.iso.org/iso-4217-currency-codes.html), in lowercase. Must be a [supported currency](https://stripe.com/docs/currencies).",
              "type": "string"
            },
            "customer": {
              "maxLength": 5000,
              "type": "string"
            },
            "expand": {
              "description": "Specifies which fields in the response should be expanded.",
              "items": {
                "maxLength": 5000,
                "type": "string"
              },
              "type": "array"
            },
            "return_url": {
              "description": "The URL that the cardholder's browser will be returned to when authentication completes.",
              "type": "string"
            }
          },
          "required": [
            "amount",
            "currency",
            "return_url"
          ],
          "type": "object"
        }
      }
    },
    "required": true
  },
  "responses": {
    "200": {
      "content": {
        "application/json": {
          "schema": {
            "$ref": "#/components/schemas/three_d_secure"
          }
        }
      },
      "description": "Successful response."
    },
    "default": {
      "content": {
        "application/json": {
          "schema": {
            "$ref": "#/components/schemas/error"
          }
        }
      },
      "description": "Error response."
    }
  },
  "path": "/v1/3d_secure",
  "method": "post"
}
```

